interface GameState {
  // Direct flags (optional, but recommended)
  flags?: {
    quest_dragon_slayer: 'not_started' | 'started' | 'complete';
    item_ancient_key: boolean;
  };
  
  // Player properties (flattened to $player_*)
  player?: {
    hp: number;
    maxHp: number;
    name: string;
    // Nested objects are flattened too
    affinity: {
      A: number;  // Becomes $player_affinity_A
      B: number;  // Becomes $player_affinity_B
    };
    elementAffinity: {
      fire: number;   // Becomes $player_elementAffinity_fire
      water: number;  // Becomes $player_elementAffinity_water
    };
  };
  
  // Characters as object (not array)
  characters?: {
    alice: { hp: 50, name: 'Alice' };  // Becomes $characters_alice_hp, $characters_alice_name
    bob: { hp: 30, name: 'Bob' };      // Becomes $characters_bob_hp, $characters_bob_name
  };
  
  // Any other game data
  inventory?: string[];
  location?: string;
}

const gameState: GameState = {
  flags: {
    quest_dragon_slayer: 'not_started',
    item_ancient_key: false,
  },
  player: {
    hp: 75,
    maxHp: 100,
    name: 'Hero',
    affinity: { A: 0.8, B: 0.5, C: 0.2 },
    elementAffinity: { fire: 0.9, water: 0.3 },
  },
  characters: {
    alice: { hp: 50, name: 'Alice' },
    bob: { hp: 30, name: 'Bob' },
  },
};`,language:"typescript"}),(0,y.jsx)("h3",{className:"text-lg font-semibold mt-6 mb-2 text-white",children:"Automatic Flattening"}),(0,y.jsx)("p",{className:"text-gray-400 mb-3",children:"When you pass gameState to ScenePlayer, it's automatically flattened into Yarn-compatible variables:"}),(0,y.jsxs)("div",{className:"bg-[#12121a] p-4 rounded border border-[#2a2a3e]",children:[(0,y.jsx)("p",{className:"text-gray-300 text-xs mb-2 font-semibold",children:"Flattening Rules:"}),(0,y.jsxs)("ul",{className:"list-disc list-inside space-y-1 text-xs text-gray-400 ml-2",children:[(0,y.jsxs)("li",{children:[(0,y.jsx)("strong",{children:"Nested objects:"})," ",(0,y.jsx)("code",{children:"player.hp"}),"  ",(0,y.jsx)("code",{children:"$player_hp"})]}),(0,y.jsxs)("li",{children:[(0,y.jsx)("strong",{children:"Deep nesting:"})," ",(0,y.jsx)("code",{children:"player.affinity.A"}),"  ",(0,y.jsx)("code",{children:"$player_affinity_A"})]}),(0,y.jsxs)("li",{children:[(0,y.jsx)("strong",{children:"Object keys:"})," ",(0,y.jsx)("code",{children:"characters.alice.hp"}),"  ",(0,y.jsx)("code",{children:"$characters_alice_hp"})]}),(0,y.jsxs)("li",{children:[(0,y.jsx)("strong",{children:"Arrays:"})," ",(0,y.jsx)("code",{children:"inventory[0]"}),"  ",(0,y.jsx)("code",{children:"$inventory_0"})]}),(0,y.jsxs)("li",{children:[(0,y.jsx)("strong",{children:"Only truthy values:"})," Skips 0, false, null, undefined, empty strings"]}),(0,y.jsxs)("li",{children:[(0,y.jsx)("strong",{children:"Yarn-compatible types:"})," Only boolean, number, string (validated)"]})]})]}),(0,y.jsx)("h3",{className:"text-lg font-semibold mt-6 mb-2 text-white",children:"Using in Yarn Conditions"}),(0,y.jsx)("p",{className:"text-gray-400 mb-3",children:"Flattened variables can be used in dialogue conditions:"}),(0,y.jsx)(lD,{code:`// In your dialogue nodes, use flattened variable names:

